import React from "react";
import './Rugby.css';
import rugbyimg from  '../image/img10.jpg';
function Rugby() {
    return (
        <>
        <div className="Rugby">


            <div >
                <h1>Rugby</h1>
                <img src={rugbyimg} alt="BigCo Inc. logo"/>
            </div>

        </div>
        </>
    );
}

export default Rugby;
